;; gorilla-repl.fileformat = 1

;; **
;;; # Simple symbolic regression
;;; 
;;; This worksheet demonstrates how to run a symbolic regression with a basic tournament selection GA.
;; **

;; @@
(ns algebolic.demo.simple-sr
  (:require [gorilla-plot.core :as plot]
            [algebolic.expression.core :as expression]
            [algebolic.expression.tree :as tree]
            [algebolic.expression.genetics :as genetics]
            [algebolic.expression.score :as score]
            [algebolic.evolution.core :as evolution]
            [algebolic.evolution.metrics :as metrics]
            [algebolic.evolution.reproduction :as reproduction]
            [algebolic.evolution.scoring :as scoring]
            [algebolic.evolution.selection :as selection]
            [algebolic.evolution.transform :as transform]
            [algebolic.algorithms.sso :as sso]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## Polynomial
;; **

;; @@
(def xs (range 0.0 10.0 1.0))
(def coords (mapv (fn [x] [x]) xs))
(def data (mapv (fn [x] (+ (* 2 x) (* 3 x x))) xs))
(def vars '[x])
(def functions (expression/get-functions #{:plus :times :minus}))
(def terminals (expression/terminal-generators vars))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.simple-sr/terminals</span>","value":"#'algebolic.demo.simple-sr/terminals"}
;; <=

;; @@
(def generation-config
  (let [size-limit 60
        min-size 5
        ea-config (sso/sso-ea-config
                    {:tournament-size 5
                     :goal :error
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 45}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 5) :repeat 5}
                                 {:op identity :repeat 5}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords data ex))
                         :error-pp (fn [ex] (score/abs-error-pp vars coords data 5 ex))}]
    {:ea-config              ea-config
     :transformations        [
                               ;;(partial transform/apply-to-fraction-of-genotypes
                               ;;        (partial transform/hill-descent
                               ;;                 genetics/twiddle-constants
                               ;;                 (:error score-functions))
                               ;;        0.5)
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/trim-hard size-limit))
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/boost-hard min-size
                                                #(genetics/random-full-tree functions terminals 3)))]
     :score-functions        score-functions
     :reporting-function     (fn [z] (print ".") (flush))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.simple-sr/generation-config</span>","value":"#'algebolic.demo.simple-sr/generation-config"}
;; <=

;; @@
(def initial-zg
  (evolution/make-zeitgeist (genetics/ramped-half-and-half-population functions terminals 100 6)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.simple-sr/initial-zg</span>","value":"#'algebolic.demo.simple-sr/initial-zg"}
;; <=

;; @@
(time (def result (evolution/run-evolution generation-config initial-zg (fn [zg gc] (>= (:age zg) 150)))))
